function view(model) {
  return $element.fragment(
    toList([
      $html.style(toList([]), css),
      $html.div(
        toList([
          $attribute.class$("grid grid-cols-[var(--sidebar)_1fr] h-screen"),
          $attribute.style(
            "--sidebar",
            (() => {
              let $ = model.sidebar_open;
              if ($) {
                return "300px";
              } else {
                return "0";
              }
            })(),
          ),
        ]),
        toList([
          $html.div(
            toList([$attribute.class$("h-full overflow-x-clip")]),
            toList([
              $html.aside(
                toList([
                  $attribute.class$("h-full flex flex-col px-4 gap-8 border-r"),
                ]),
                toList([
                  $html.h1(
                    toList([$attribute.class$("h-12 flex items-center")]),
                    toList([$html.text(model.title)]),
                  ),
                  view_nav(model.chapters),
                ]),
              ),
            ]),
          ),
          $html.div(
            toList([$attribute.class$("h-full flex flex-col")]),
            toList([
              $html.header(
                toList([
                  $attribute.class$(
                    "h-12 border-b flex items-center px-4 gap-4",
                  ),
                ]),
                toList([
                  $html.button(
                    toList([$event.on_click(new UserToggledSidebar())]),
                    toList([
                      $icon.sidebar(toList([$attribute.class$("size-4")])),
                    ]),
                  ),
                  $ui.breadcrumb(model.route, model.chapters),
                ]),
              ),
              (() => {
                let $ = model.route;
                if ($ instanceof $route.Index) {
                  return $html.text("");
                } else if ($ instanceof $route.NotFound) {
                  return $html.text("");
                } else if ($ instanceof $route.Chapter) {
                  let c = $.chapter;
                  return view_chapter(c, model.chapters);
                } else {
                  let c = $.chapter;
                  let s = $.story;
                  return view_story(c, s, model.chapters);
                }
              })(),
            ]),
          ),
        ]),
      ),
    ]),
  );
}

export function start(book) {
  return $result.try$(
    $list.try_map(
      book.chapters,
      (chapter) => {
        return $chapter.init(
          chapter[0],
          chapter[1],
          book.stylesheets,
          book.external_stylesheets,
        );
      },
    ),
    (chapters) => {
      let app = $lustre.application(init, update, view);
      let args = new Args(book.title, chapters);
      return $result.try$(
        $lustre.start(app, "#app", args),
        (_) => { return new Ok(undefined); },
      );
    },
  );
}
